script: |
  super -f text -I q12874.spq | sort > q12874.out

inputs:
  - name: q12874.spq
    data: |
      SELECT ALL + 90 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col2 + + col1 * - 10 * - col1 IS NULL;
  - name: tab2

outputs:
  - name: q12874.out
    data: |
      90
      90
      90
